import { View, Text} from 'react-native'
import React from 'react'
import { SafeAreaView } from 'react-native-safe-area-context'

const History = () => {
  return (
    <SafeAreaView>
      <Text>Riwayat Data</Text>
    </SafeAreaView>
  )
}

export default History;
